<script>
import AppHeader from '../components/AppHeader.vue';
import axios from 'axios';
export default {
  name: 'Auto',
  components: {
    AppHeader,
  },
  data() {
    return {
      auto: {},
      polling_refresh: null,
      polling_api: null,
      api_version: null,
      controller: null,
      ui: null,
      showModal: false,
      baseURL : 'http://' + window.location.hostname
    };
  },
  mounted: function () {
    this.$nextTick(function () {
      this.initAuto();
    });
  },
  created() {
    console.log(this.baseURL);
    this.loadData();
    this.pollApi();
    this.pollUpdate();
  },
  methods: {
    initAuto() {
      this.auto.root = document.getElementById('auto2');
      this.auto.speed = document.getElementById('speed');
      this.auto.g1 = document.getElementById('guage1');
      this.auto.g2 = document.getElementById('guage2');
      this.auto.speedInt = null;

      this.auto.btns = {};
      this.auto.btns.init = document.getElementById('btn_init');
      this.auto.btns.lights = document.getElementById('btn_lights');
      this.auto.btns.beam = document.getElementById('btn_beam');
      this.auto.btns.seat = document.getElementById('btn_seat');
      this.auto.btns.acc = document.getElementById('btn_acc');
      this.auto.btns.gear_r = document.getElementById('btn_gear_r');
      this.auto.btns.gear_p = document.getElementById('btn_gear_p');
      this.auto.btns.gear_n = document.getElementById('btn_gear_n');
      this.auto.btns.gear_d = document.getElementById('btn_gear_d');
      this.auto.btns.v1_1 = document.getElementById('btn_v1_1');
      this.auto.btns.v2_1 = document.getElementById('btn_v2_1');

      this.auto.config = {};
      this.auto.config.version = 'V1_1'; //downloaded snap version (can also be v2_1)
      this.auto.config.on = false; //car running or not
      this.auto.config.lights = false; //lights
      this.auto.config.beam = false; //fullbeam lights
      this.auto.config.seat = false; //seatbelt on or not
      this.auto.config.speed = 0; //mph
      this.auto.config.gear = 'gear_p'; //which gear is it in


      //init classes
      this.auto.root.classList.add(this.auto.config.version);
      this.auto.root.classList.add(this.auto.config.gear);
      this.auto.root.classList.toggle('on', this.auto.config.on);
      this.auto.root.classList.toggle('light', this.auto.config.lights);
      this.auto.root.classList.toggle('beam', this.auto.config.beam);
      this.auto.root.classList.toggle('seat', this.auto.config.seat);

      this.auto.speed.innerHTML = this.auto.config.speed;
      this.auto.g1.style.transform =
        'rotate(' + (this.auto.config.speed * 1.5 - 120) + 'deg)';
      this.auto.g2.style.transform =
        'rotate(' + (this.auto.config.speed * 0.5 - 90) + 'deg)';

      this.version_1();
      this.startVehicle(true);

      this.speedchange(0);

    },
    startVehicle(isStarting) {
      // Set the speed of the vehicle to 0
      this.auto.config.speed = 0;

      // Rotate the vehicle's style based on the parameter
      this.auto.g2.style.transform =
        'rotate(' + (isStarting ? -120 : -90) + 'deg)';

      // Toggle the on/off state of the vehicle
      this.auto.config.on = isStarting;

      // Toggle the 'on' class in the root element based on the on/off state
      this.auto.root.classList.toggle('on', this.auto.config.on);
    },
    toggleLights() {
        this.auto.config.lights = !this.auto.config.lights;
        this.auto.root.classList.toggle('light', this.auto.config.lights);
    },
    toggleFullBeam() {
        this.auto.config.beam = !this.auto.config.beam;
        this.auto.root.classList.toggle('beam', this.auto.config.beam);
    },
    toggleSeatBelt() {
        this.auto.config.seat = !this.auto.config.seat;
        this.auto.root.classList.toggle('seat', this.auto.config.seat);
    },
    gearR() {
        this.auto.root.classList.remove('gear_r', 'gear_p', 'gear_n', 'gear_d');
        this.auto.config.gear = 'gear_r';
        this.auto.root.classList.add(this.auto.config.gear);
    },
    gearP() {
        this.auto.root.classList.remove('gear_r', 'gear_p', 'gear_n', 'gear_d');
        this.auto.config.gear = 'gear_p';
        this.auto.root.classList.add(this.auto.config.gear);
    },
    gearN() {
        this.auto.root.classList.remove('gear_r', 'gear_p', 'gear_n', 'gear_d');
        this.auto.config.gear = 'gear_n';
        this.auto.root.classList.add(this.auto.config.gear);
    },
    gearD() {
        this.auto.root.classList.remove('gear_r', 'gear_p', 'gear_n', 'gear_d');
        this.auto.config.gear = 'gear_d';
        this.auto.root.classList.add(this.auto.config.gear);
    },
    version_1() {
        this.auto.root.classList.remove('V1_1', 'V2_1');
        this.auto.config.version = 'V1_1';
        this.auto.root.classList.add(this.auto.config.version);
        this.startVehicle(true);
    },
    version_2() {
        this.auto.root.classList.remove('V1_1', 'V2_1');
        this.auto.config.version = 'V2_1';
        this.auto.root.classList.add(this.auto.config.version);
        this.startVehicle(true);
    },
    speedchange(target) {
        if (this.auto.config.speed < target) {
          //speeding up
          clearInterval(this.auto.speedInt);
          this.auto.speedInt = setInterval(() => {
            this.auto.speed.innerHTML = this.auto.config.speed;
            this.auto.g1.style.transform =
              'rotate(' + (this.auto.config.speed * 1.5 - 120) + 'deg)';
            this.auto.g2.style.transform =
              'rotate(' + (this.auto.config.speed * 0.5 - 90) + 'deg)';
            if (this.auto.config.speed >= target) {
              clearInterval(this.auto.speedInt);
              return;
            }
            this.auto.config.speed++;
          }, 30);
        }
        if (this.auto.config.speed > target) {
          //slowing down
          clearInterval(this.auto.speedInt);
          this.auto.speedInt = setInterval(() => {
            this.auto.speed.innerHTML = this.auto.config.speed;
            this.auto.g1.style.transform =
              'rotate(' + (this.auto.config.speed * 1.5 - 120) + 'deg)';
            this.auto.g2.style.transform =
              'rotate(' + (this.auto.config.speed * 0.5 - 90) + 'deg)';
            if (this.auto.config.speed <= target) {
              clearInterval(this.auto.speedInt);
              return;
            }
            this.auto.config.speed--;
          }, 30);
        }
    },
    mouseup() {
        this.speedchange(0);
    },
    mousedown() {
        if (!this.auto.config.on) {
          alert('Vehicle not on');
        } else if (this.auto.config.gear == 'gear_n') {
          alert('Vehicle in neutral');
        } else if (this.auto.config.gear == 'gear_p') {
          alert('Vehicle in park');
        } else if (this.auto.config.gear == 'gear_r') {
          this.speedchange(30);
        } else {
          console.log("Bas Gaza aşkım")
          this.speedchange(120);
        }
    },
    async loadData() {
      const api_version = await axios.get(this.baseURL + ':4040/version');
      this.api_version = api_version.data.version
      if(this.api_version == 1) {
        this.version_1();
        const speed_v1 = await axios.get(this.baseURL + ':4040/v1/speed');
        this.speedchange(speed_v1.data.speed);
      }

      if(this.api_version == 2) {
        this.version_2();
        const speed_v2 = await axios.get(this.baseURL + ':4040/v2/speed');
        this.speedchange(speed_v2.data.speed);

        if (speed_v2.data.speed > speed_v2.data.max_speed) {
          this.showModal = true;
          await this.revert();
          const res = await axios.get(this.baseURL + ':4040/v2/speed');
          this.speedchange(speed_v2.data.speed);
        }

        if (speed_v2.data.speed <= speed_v2.data.max_speed) {
          this.showModal = false;
        }

      }

      const snaps = await axios.get(this.baseURL + ':4500/list');
      snaps.data.result.forEach((entry) => {
        if (entry.name === 'iotdevice-device-controller') {
          this.controller = entry.revision;
        }
      });

      snaps.data.result.forEach((entry) => {
        if (entry.name === 'iotdevice-device-ui') {
          this.ui = entry.revision;
        }
      });

    },
    async refresh() {
      if( !this.auto.config.on ) {
        const res = await axios.post(this.baseURL + ':4500/refresh');
        console.log(JSON.stringify(res));
      }

    },
    async revert() {
      const res = await axios.post(this.baseURL + ':4500/revert', {
        name: 'iotdevice-device-controller',
      });
      console.log(JSON.stringify(res));
    },
    pollApi() {
      this.polling_api = setInterval(() => {
        this.loadData();
      }, 1000);
    },
    pollUpdate() {
      this.polling_refresh = setInterval(() => {
        this.refresh();
      }, 45000);
    }
  },
  beforeDestroy() {
    clearInterval(this.polling_api);
    clearInterval(this.polling_refresh);
  },
};
</script>

